import React from 'react'
import { useParams } from 'react-router'

const SeminarDetails = () => {

    let { id } = useParams();

    return (
        <div>
            <h1>{id}</h1>
            <h1>{}</h1>
        </div>
    )
}

export default SeminarDetails
